import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/resume" component={Resume} />
        <Route path="/university-of-phoenix" component={Uopx} />
      </Router>
    );
  }
}

export default App;
